script: |
  super -f text -I q9675.spq | sort > q9675.out

inputs:
  - name: q9675.spq
    data: |
      SELECT ( + - col0 ) + col2 * - 42 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT NULL BETWEEN NULL AND + + col2 + + - CAST ( NULL AS INTEGER );
  - name: tab2

outputs:
  - name: q9675.out
    data: |
